import React from 'react';
import './App.css';
import Pokemon from './components/Pokemon';
import pokemons from './data';

function App() {
  return (
    <main className='mainContainer'>
      {pokemons.map(pokemon => <Pokemon pokemonInfos={pokemon} />)}
    </main>
  );
}

export default App;
